import React from "react";

export default function contact() {
  return (
    <div
      id="contact"
      className="max-w-[1300px] mx-auto justify-center items-center flex flex-col h-[80vh]"
    >
      <h1 className=" text-[50px] text-[silver]">
        <span id="span"></span> Contact Us
      </h1>
      <div></div>
    </div>
  );
}
